selector_to_html = {"a[href=\"#scatterplot\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.1. </span>Scatterplot<a class=\"headerlink\" href=\"#scatterplot\" title=\"Permalink til denne overskrift\">#</a></h1><p>For at komme et skridt n\u00e6rmere p\u00e5 at forst\u00e5, om vores data udviser en form for tendens, kan vi plotte vores datapunkter mod hinanden. Det g\u00f8r vi i et s\u00e5kaldt <em>scatterplot</em>. Lad os vise dette med et eksempel.</p>", "a[href=\"#korrelationskoefficienten-i\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.2. </span>Korrelationskoefficienten I<a class=\"headerlink\" href=\"#korrelationskoefficienten-i\" title=\"Permalink til denne overskrift\">#</a></h1><p>Sammenh\u00e6ng i vores data kan ogs\u00e5 <a class=\"reference internal\" href=\"../../Vaerktoejer/gloser.html#term-kvantificere\"><span class=\"xref std std-term\">kvantificere</span></a>s gennem korrelation. Korrelationskoefficienten er et tal, der siger noget om, hvordan den ene variabel opf\u00f8rer sig i forhold til den anden variabel. Tallet ben\u00e6vnes ofte med det gr\u00e6ske bogstav <span class=\"math notranslate nohighlight\">\\(\\rho\\)</span> (udtales \u00bbrho\u00ab).</p><p>I vores eksempel fra f\u00f8r havde vi, at n\u00e5r den ene variabel var st\u00f8rre, s\u00e5 var den anden variabel ogs\u00e5 st\u00f8rre. Vi siger, at de to variabler er <em>positivt korrelerede</em>. Det modsatte tilf\u00e6lde kan du ogs\u00e5 st\u00f8de p\u00e5. N\u00e5r en variabel bliver mindre, mens den anden variabel bliver st\u00f8rre, s\u00e5 er de to variabler <em>negativt korrelerede</em>. Hvis to variabler udvikler uden en tendens med hinanden, s\u00e5 vil de to variabler v\u00e6re <em>ukorrelerede</em>.</p>", "a[href=\"#hoejde-og-skostoerrelse-scatter\"]": "<div class=\"proof eksempel admonition\" id=\"hoejde-og-skostoerrelse-scatter\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 25.1 </span></p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Vi f\u00e5r til opgave at unders\u00f8ge, om der er en sammenh\u00e6ng mellem h\u00f8jder og skost\u00f8rrelser p\u00e5 elever i en klasse p\u00e5 et gymnasium. Vi indsamler f\u00f8lgende data</p>\n<table class=\"colwidths-auto table\">\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>H\u00f8jde i cm</p></th>\n<th class=\"head\"><p>Skost\u00f8rrelse</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p>182.3</p></td>\n<td><p>43</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>184.4</p></td>\n<td><p>44</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>168.1</p></td>\n<td><p>39</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>165.4</p></td>\n<td><p>37</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>164.7</p></td>\n<td><p>37</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>172.1</p></td>\n<td><p>40</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>191.4</p></td>\n<td><p>46</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>197.8</p></td>\n<td><p>46</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>187.9</p></td>\n<td><p>44</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>182.1</p></td>\n<td><p>42</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>182.6</p></td>\n<td><p>43</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>188.2</p></td>\n<td><p>44</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>190.0</p></td>\n<td><p>45</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>181.7</p></td>\n<td><p>42</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>169.4</p></td>\n<td><p>39</p></td>\n</tr>\n</tbody>\n</table>\n<p>Vi lader nu H\u00f8jde i cm v\u00e6re variablen langs <span class=\"math notranslate nohighlight\">\\(x\\)</span>-aksen og Skost\u00f8rrelse v\u00e6re variablen langs <span class=\"math notranslate nohighlight\">\\(y\\)</span>-aksen.</p>\n<figure class=\"align-default\">\n<img alt=\"../../../_images/189b6b2f32221091d10ecd4f57a1e12a14e58a406c7a034b1c7b0ec8571c0e50.png\" src=\"../../../_images/189b6b2f32221091d10ecd4f57a1e12a14e58a406c7a034b1c7b0ec8571c0e50.png\"/>\n</figure>\n<p>Af scatterplottet bliver det tydeligt, at der er en tendens: Elever, der er h\u00f8jere, bruger ogs\u00e5 st\u00f8rre sko.</p>\n</section>\n</div>", "a[href=\"../../Vaerktoejer/gloser.html#term-kvantificere\"]": "<dt id=\"term-kvantificere\">kvantificere</dt><dd><p>At oms\u00e6tte noget s\u00e5 det kan t\u00e6lles eller m\u00e5les.</p></dd>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
